import React, { useEffect, useState } from 'react'
import { Typography } from 'antd';

export function Onboard() {
    const [id, changeId] = useState(undefined);
    useEffect(() => {
        // @ts-ignore
        window.memberstack.onReady.then(function(member) {
            changeId(id)
        })
    });
    return (
        <div>
            <Typography>{id}</Typography>
        </div>
    );
}
